string input = "";
//string input = "nppdvjthqldpwncqszvftbrmjlhg";

Queue<char> prev = new Queue<char>();

int firstMarker = -1;
bool found = false;

int pos = 0;
foreach (char c in input)
{
    pos++;
    prev.Enqueue(c);
    if (prev.Count == 15)
    {
        prev.Dequeue();
    }
    if (!found && prev.Count == 14)
    {
        if (prev.ToHashSet().Count == prev.Count)
        {
            found = true;
            firstMarker = pos;
        }
    }
}

Console.WriteLine(firstMarker);

